import React from 'react';
import { Card, Button } from 'react-bootstrap';

export default class Chart extends React.Component {
  constructor(props) {
    super(props);
    this.state = {}
  }

  render() {
    return (
<div>
<Chart
          chartType="ScatterChart"
          data={[["Age", "Weight"], [4, 5.5], [8, 12]]}
          width="100%"
          height="400px"
          legendToggle
        />
<h1>Chart....</h1>
</div>
    )}


}
